package com.example.circlea;

import androidx.appcompat.app.AppCompatActivity;
import androidx.recyclerview.widget.GridLayoutManager;
import androidx.recyclerview.widget.RecyclerView;

import android.content.Intent;
import android.os.Bundle;
import android.view.View;
import android.widget.TextView;

import com.google.android.material.floatingactionbutton.FloatingActionButton;

import java.util.ArrayList;

public class category extends AppCompatActivity {

    @Override
    protected void onCreate(Bundle savedInstanceState) {
        super.onCreate(savedInstanceState);
        setContentView(R.layout.category);
        ArrayList<Product> prods=new ArrayList<>();

        prods.add(new Product("chesse burger","data:image/jpeg;base64,"
                ,"60","burger"));
        prods.add(new Product("Big Tasty","data:image/jpeg;base64,",
                "50","burger"));
        prods.add(new Product("Chicken Burger","data:image/jpeg;base64,",
                "60","burger"));
        prods.add(new Product("Smoked BBQ Chicken Burger","data:image/jpeg;base64,",
                "70","burger"));
        prods.add(new Product("Chicken Ranch Pizza","data:image/jpeg;base64,",
                "80","pizza"));
        prods.add(new Product("Margehrita Pizza","data:image/jpeg;base64,",
                "70","pizza"));

        prods.add(new Product("Pepproni Pizza","data:image/jpeg;base64,",
                "80","pizza"));
        prods.add(new Product("Seafood Pizza","data:image/jpeg;base64,",
                "100","pizza"));
        prods.add(new Product("Fettuccine Alfredo","data:image/jpeg;base64,","80","Pasta"));
        prods.add(new Product("Red Sauce Pasta","data:image/jpeg;base64,","70","Pasta"));
        prods.add(new Product("White Sauce Pasta","data:image/jpeg;base64,","80","Pasta"));
        FloatingActionButton cartBtn = findViewById(R.id.cart_floating_btn2);
        cartBtn.setOnClickListener(new View.OnClickListener() {
            @Override
            public void onClick(View view) {
                Intent i = new Intent(category.this, CartActivity.class);
                startActivity(i);
            }
        });
        Bundle extras=getIntent().getExtras();
        TextView title=(TextView) findViewById(R.id.categoryTitle);
        TextView desc=(TextView) findViewById(R.id.categorydesc);
        if(extras.getString("category").equals("Burgers")){
            title.setText("Burger Lovers");
            desc.setText("craving Burger ?");
            ArrayList<Product> realprods=new ArrayList<>();
            for(int i=0;i<prods.size();i++){
                if(prods.get(i).getCategory().equals("burger"))
                    realprods.add(prods.get(i));
            }
            RecyclerView prodRV;
            ProductAdaptor productAdaptor=new ProductAdaptor(this);
            productAdaptor.setProducts(realprods);
            prodRV=findViewById(R.id.products_RV);
            prodRV.setAdapter(productAdaptor);
            prodRV.setLayoutManager(new GridLayoutManager(this,3));

        }
        else if(extras.getString("category").equals("Pizza")){
            title.setText("Pizza Lovers");
            desc.setText("Satisfy your Pizza craving.Order now");
            ArrayList<Product> realprods=new ArrayList<>();
            for(int i=0;i<prods.size();i++){
                if(prods.get(i).getCategory().equals("pizza"))
                    realprods.add(prods.get(i));
            }
            RecyclerView prodRV;
            ProductAdaptor productAdaptor=new ProductAdaptor(this);
            productAdaptor.setProducts(realprods);
            prodRV=findViewById(R.id.products_RV);
            prodRV.setAdapter(productAdaptor);
            prodRV.setLayoutManager(new GridLayoutManager(this,3));

        }
        else if(extras.getString("category").equals("Pasta")){
            title.setText("Pasta Lovers");
            desc.setText("Craving Pasta?");
            ArrayList<Product> realprods=new ArrayList<>();
            for(int i=0;i<prods.size();i++){
                if(prods.get(i).getCategory().equals("Pasta"))
                    realprods.add(prods.get(i));
            }
            RecyclerView prodRV;
            ProductAdaptor productAdaptor=new ProductAdaptor(this);
            productAdaptor.setProducts(realprods);
            prodRV=findViewById(R.id.products_RV);
            prodRV.setAdapter(productAdaptor);
            prodRV.setLayoutManager(new GridLayoutManager(this,3));

        }
        else{
            title.setText("Circle A");
            desc.setText("Fast and Delicious Food");


            RecyclerView prodRV;
            ProductAdaptor productAdaptor=new ProductAdaptor(this);
            productAdaptor.setProducts(prods);
            prodRV=findViewById(R.id.products_RV);
            prodRV.setAdapter(productAdaptor);
            prodRV.setLayoutManager(new GridLayoutManager(this,3));

        }
    }
}